// pre: list != null and 
// elements in list are sorted in 
// ascending order. 
public int search(List<Integer> d,  
int tgt){
  Integer t = new Integer(tgt); 
  int res = -1; 
  int low = 0; 
  int hi = d.size() - 1; 
  int count = 0; 
  while( res == -1 && low <= hi ){ 
    count++; 
    int mid = (low + hi) / 2; 
    int diff = t.compareTo( d.get(mid) );  
    if( diff == 0 ) 
      res = mid; 
    else if( diff > 0 ) 
      low = mid + 1; 
    else 
      hi = mid -1; 
  } 
  return res; 
} 

