public void ps(int[] d, int p, 
       ArrayList<Integer> cur,  
       ArrayList<ArrayList<Integer>> res){ 

  if(p == d.length) 
    res.add( gc(cur) ); 
  else{ 
    ps(d, p + 1, cur, res); 
    cur.add(d[p]); 
    ps(d, p + 1, cur, res); 
